import React from "react";
import { useState } from "react";
import "./popup.css";

function POPUP({ elements, enable,...otherProps }) {
  const [enabled, setEnabled] = useState(false);
  setEnabled(enable?enable:enabled);

  const handleEventClick = () => {
    setEnabled(false);
  };
  return (
    <div className={enabled ? "popup" : "hide"} {...otherProps}>
      <div className="title">Details</div>
      <div className="description">
        <ul>
          {elements.map((element) => {
            return <li className="list">{element}</li>;
          })}
        </ul>
      </div>
      <div className="dismiss-btn">
        <button className="dismiss-popup-btn" onClick={handleEventClick}>
          Dismiss
        </button>
      </div>
    </div>
  );
}

export default POPUP;
